import CartWidget from "../CartWidget/CartWidget";
import { Link, NavLink } from "react-router-dom";

import "./style.css";

function Navbar() {
  return (
    <div className="divLinks">
      <NavLink
        className={(estatus) => 
          estatus.isActive ? 'active' : 'inactive'
        }
        to=''
      >

      </NavLink>
        <a href="" className="Links"> Más vendidos </a>
        <a href="" className="Links"> Comestibles </a>
        <a href="" className="Links"> Cosmética </a>
        <a href="" className="Links"> Historial de pedidos </a>
    </div>
  )
}

export default Navbar








